import React, {Component} from "react"
import {TextField} from "@material-ui/core"

export function Textbox(){
  return (
    <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
      <TextField id="outlined-basic" label="Enter name" variant="outlined" />
      </Box>
  )
}
